import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../css/optimizacion.css';
import SeccionDato from './SeccionDato';

class SeccionForm extends React.Component{
    render(){
        return(
            <div>
                <div className="encabezado">
                    <h2><i className="fas fa-ice-cream"></i>{this.props.titulo}</h2>
                    <div className="form-group row">
                        <div className="col-9 text">
                            <h4>{this.props.nombreTipo}</h4>
                        </div>
                    </div>
                    <div className="col-3">
                        <h4><i className="fas fa-chart-line"></i>{this.props.nombreCantidad}</h4>
                    </div>
                </div>
                <SeccionDato />
                <SeccionDato />
                <SeccionDato />
                <button type="button" className="btn btn-dark" id="agregarSabor"><i className="fas fa-plus"></i> Agregar sabor</button>
            </div>
        )
    }
}

export default SeccionForm;
